    let addPost = () => alert(2);

    let newPostElement = React.createRef();

    return (
        <div className={classes.posts_block}>
            My Posts
            <div>
                <div>
                    <textarea re></textarea>
                </div>
                <div>
                    <button onClick={addPost }>Add post</button>
                </div>
                
            </div>
            <div className={classes.posts}>
                {postsElements}
            </div>
        </div>
    )
}

